var ptArray;
var lineArray=[];

function setup() {
    createCanvas(windowWidth, windowHeight);
    background(255);
    ptArray = songArray.map(
        (value, index) => {
            return new Pt(width / 2 + value * 1000 * cos(Math.PI * 2 / songArray.length * index), height / 2 + value * 1000 * sin(Math.PI * 2 / songArray.length * index));
        });
    for (let i = 0; i < songArray.length; i++) {
        stroke(random(255), random(255), 255, 30);
        strokeWeight(1);
        lineArray.push(new Line2(new Pt(width / 2, height / 2), ptArray[i]));
        lineArray[i].render();
    }
}




function polylineFromPts(pts) {
    var num = pts.length;
    beginShape();
    for (let i = 0; i < num; i++) {
        vertex(pts[i].x, pts[i].y);
    }
    endShape();
}

function curveFromPts(pts) {
    var num = pts.length;
    beginShape();
    curveVertex(pts[0].x, pts[0].y);
    for (let i = 0; i < num; i++) {
        curveVertex(pts[i].x, pts[i].y);
    }
    curveVertex(pts[num - 1].x, pts[num - 1].y);
    endShape();
}

function line2pt(startPt, endPt) {
    line(startPt.x, startPt.y, endPt.x, endPt.y);
}
